import React from 'react';
import './App.css';
import EmployeeForm from './components/EmployeeForm';
import ProjectForm from './components/ProjectForm';
import TaskForm from './components/TaskForm';
import TaskList from './components/TaskList';

const App = () => {
  return (
    <div>
      <h1>Task Manager</h1>
      <EmployeeForm />
      <ProjectForm />
      <TaskForm />
      <TaskList />
    </div>
  );
};

export default App;
